	g_Vars.Player_EnemyGlow[0] = 255, g_Vars.Player_EnemyGlow[1] = 0, g_Vars.Player_EnemyGlow[2] = 0;
	g_Vars.Player_TeammateColor[0] = 255, g_Vars.Player_TeammateColor[1] = 0, g_Vars.Player_TeammateColor[2] = 0;
	g_Vars.Player_EnemyColor[0] = 0, g_Vars.Player_EnemyColor[1] = 0, g_Vars.Player_EnemyColor[2] = 255;
